// Navbar.js

import React, { useState } from 'react';
import './Navbar.css';
import { Link, Route, Routes } from 'react-router-dom';
import Da from '../Da/Da';
import Hra from '../Hra/Hra';
import Employee from '../Employee/Employee';
import Crud from '../Crud/Crud';
import Home from '../Home/Home';
import Register from '../Register/Register'
im

function Navbar() {
  const [showEmployeeDropdown, setShowEmployeeDropdown] = useState(false);
  const [showDaDropdown, setShowDaDropdown] = useState(false);
  const [showHraDropdown, setShowHraDropdown] = useState(false);

  const toggleEmployeeDropdown = () => {
    setShowEmployeeDropdown(!showEmployeeDropdown);
  };

  const toggleDaDropdown = () => {
    setShowDaDropdown(!showDaDropdown);
  };

  const toggleHraDropdown = () => {
    setShowHraDropdown(!showHraDropdown);
  };

  return (
    <>
      <div className="navbar">
        <nav>
          <p>MITTAPALI SPINNERS PVT.LTD</p>
          <ul>
            <li>
              <Link className="name" to="/">
                Home
              </Link>
            </li>
            <li>
              <Link className="name" to="/Home">
                Salary
              </Link>
            </li>
            <li>
              <div className="dropdown" onMouseEnter={toggleEmployeeDropdown} onMouseLeave={toggleEmployeeDropdown}>
              <Link className="name" to="/Employee">
                Employee
              </Link>
                {showEmployeeDropdown && (
                  <div className="dropdown-content">
                    <Link to="/Employee">Employee Page</Link>
                    {/* Add more links related to Employee */}
                  </div>
                )}
              </div>
            </li>
            <li>
              <div className="dropdown" onMouseEnter={toggleDaDropdown} onMouseLeave={toggleDaDropdown}>
              <Link className="name" to="/Da">
                DA
              </Link>
                {showDaDropdown && (
                  <div className="dropdown-content">
                    <Link to="/Da">DA Page</Link>
                    {/* Add more links related to DA */}
                  </div>
                )}
              </div>
            </li>
            <li>
              <div className="dropdown" onMouseEnter={toggleHraDropdown} onMouseLeave={toggleHraDropdown}>
              <Link className="name" to="/Hra">
                HRA
              </Link>
                {showHraDropdown && (
                  <div className="dropdown-content">
                    <Link to="/Hra">HRA Page</Link>
                    {/* Add more links related to HRA */}
                  </div>
                )}
              </div>
            </li>
            <li>
              <Link className="name" to="/Crud">
                PF
              </Link>
            </li>
          </ul>
        </nav>
      </div>
      <Routes>
        <Route path="/" element={<Register />} />
        <Route path="/Home" element={<Home />} />
        <Route path="/Hra" element={<Hra />} />
        <Route path="/Da" element={<Da />} />
        <Route path="/Employee" element={<Employee />} />
        <Route path="/Crud" element={<Crud />} />
      </Routes>
    </>
  );
}

export default Navbar;
